  false,\n\t\"url\": null,\n\t\"notes\": \"From 1986 to 1999, The National Marine
  Mammal Laboratories' California Current Ecosystem Program (AFSC/NOAA) collected
  fecal samples and stomachs of male California sea lions from Washington. Scat samples
  were collected primarily from haulout sites in Puget Sound and a few were collected
  along the northern-outer Washington coast. Stomach content samples were collected
  from dead/stranded California sea lions throughout Washington. The data contains
  prey identifications and analyses of samples including prey species composition,
  frequency of occurrence, and size of prey.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
